mutation ConfirmBidCreateBidderPositionMutation(
  $input: BidderPositionInput!
) {
  createBidderPosition(input: $input) {
    result {
      status
      message_header
      message_description_md
      position {
        id
        suggested_next_bid {
          cents
          display
        }
        __id
      }
    }
  }
}
